# Apache Flink Configuration - Streaming ETL Cluster

# JobManager配置
jobmanager.rpc.address: flink-taskmanager
jobmanager.rpc.port: 6123
jobmanager.bind-host: 0.0.0.0
jobmanager.memory.process.size: 1600m

# TaskManager配置
taskmanager.rpc.port: 6122
taskmanager.bind-host: 0.0.0.0
taskmanager.host: flink-taskmanager
taskmanager.numberOfTaskSlots: 2
taskmanager.memory.process.size: 1728m

# 并行度配置
parallelism.default: 2

# 重启策略
restart-strategy: fixed-delay
restart-strategy.fixed-delay.attempts: 3
restart-strategy.fixed-delay.delay: 10s

# 检查点配置
state.backend: filesystem
state.checkpoints.dir: file:///opt/flink-data/checkpoints
execution.checkpointing.interval: 30s
execution.checkpointing.timeout: 10min

# Web UI配置
web.submit.enable: true
web.upload.dir: /tmp/flink-web-uploads

# 时区配置
table.local-time-zone: Asia/Shanghai

# 类加载配置
classloader.resolve-order: child-first
query.server.port: 6125
